import React from 'react';
import { Link } from 'react-router-dom';

const TopOfSite = () => {
  return  <>
    <nav className={styles}>
      <ul>
        <li><Link to='/'>To Home</Link></li>
        <li>Todo List</li>
        <li><Link to='/userRegistration'>Registration User</Link></li>
        <li>Ches</li>
        <button>Switch</button>
      </ul>
    </nav>
   </>
  
}

export default TopOfSite;
